if mibBuilder.loadTexts: sc5553DiagTestResults.setDescription('The results of the last diagnostic test. This can be the current test running or the last completed test. The units of the value of this object depend on the type of diagnostic test run. For all cases except a network delay measurement, the units of the value of this object is the number of bit errors that occurred. Bit errors can be read at any time during the duration of the test. The valid range for bit errors is 0 to 4,095. 65,535 will be returned if for any reason the test was terminated early. 32,770 will be returned if the number of bit errors exceeds 4,095. For a network delay measurement, the units of the value of this test are milliseconds. If the test is terminated early than 65,535 will be returned and if the delay is greater than 4,095 milliseconds then 32,770 will be returned.')
