sc5553DiagTestSelection = MibTableColumn((1, 3, 6, 1, 4, 1, 498, 6, 5, 5, 1, 1, 5), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5, 6, 7))).clone(namedValues=NamedValues(("stopTestorNoTest", 1), ("localloop", 2), ("localloopselftest", 3), ("digitalLoop", 4), ("remoteloop", 5), ("remoteloopselftest", 6), ("networkdelay", 7)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: sc5553DiagTestSelection.setStatus('mandatory')
if mibBuilder.loadTexts: sc5553DiagTestSelection.setDescription('To halt the execution of any and all diagnostic tests that may be running, SET this object to stopTestorNoTest(1). LocalLoopBack: To initiate a LocalLoopBack with no SelfTest, SET this object to localloop(2). Data from the DTE will be looped back to itself. This loopback can be terminated by sending stopTestorNoTest(1). LocalLoopBack with SelfTest: To initiate a LocalLoopBack SelfTest, SET this object to localloopselftest(3). The pattern specified in sc5553DiagPattern will be sent and checked for bit errors. The test will run for the time specified in sc5553DiagTestDuration, unless terminated by sending stopTestorNoTest(1). Test results can be checked by reading the sc5553DiagTestResults object. DigitalLoopback: To initiate a DigitalLoopback test SET this object to digitalLoop(4). This will allow the data from the DTE attached to the far end unit (nms553) to be looped back to itself. This loopback can be terminated by sending stopTestorNoTest(1). RemoteLoopback: To initiate a RemoteLoopback test with no SelfTest, SET this object to remoteloop(5). The sc5553 DSE transmits an in-band command to its remote DSU, directing the remote to loop received signals back to the network. The DSE is configurable to send (and accept) a PN127 remote loop command. The remote DSU must be configured to accept the same command the DSE transmits. This loopback can be terminated by sending stopTestorNoTest(1). RemoteLoopback with SelfTest: To initiate a RemoteLoopback with SelfTest SET this object to remoteloopselftest(6). The remote unit will go into remoteloopback and the master (sc5553) unit will go into Selftest. The sc5553 transmits an in-band command to its remote DSU, directing the remote to loop received signals back onto the network. The DSE is configurable to send (and accept) a PN127 remote loop command. The remote DSU must be configured to accept the same command the DSE transmits. The sc5553 enables its internal Test Pattern Generator to provide the signal for the Remote Loop and enables the Pattern Generator to verify the signal. The pattern specified in sc5553DiagPattern will be sent for this test. The test will run for the time specified in sc5553DiagTestDuration, unless terminated by sending stopTestorNoTest(1). Test results can be checked by reading the sc5553DiagTestResults object. Network Delay: To initiate a Network Delay Test SET this object to networkdelay(7). The results are valid only after the test is completed which takes about 10 seconds. Network Delay Time can be checked by reading the sc5553DiagTestResults object after completion of the test. For a GET, the value stopTestorNoTest(1) indicates there are no active diagnostic tests currently running. Any other value indicates which test is currently active.')
